import React, { Component } from 'react';
import Cards from 'components/cards.jsx'
import axios from 'axios'
axios.get('https://quantified-api.herokuapp.com/v1/foods')
  .then((foods) => {
    console.log(foods)
  })
  .catch((error) => {
    console.error(error)
  })


class CourseHome extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data: [{
                "userId": "card 1",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked": "maincardview",

            }, {
                "userId": "card 2",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked": "maincardview",

            }, {
                "userId": "card 3",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked": "maincardview",


            }, {
                "userId": "card 4",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked": "maincardview",


            }
                , {
                "userId": "card 5",
                "id": 1,
                "title": "delectus aut autem",
                "completed": false,
                "linked": "maincardview",

            }],
            agents: [{
                "id": 1,
                "Agent": "Osama Ahmed Tahir"
            }, {

                "id": 2,
                "Agent": "Ali Jasim"
            }, {

                "id": 3,
                "Agent": "MukhtaBani"

            }, {
                "id": 4,
                "Agent": "Sanchit"

            }
                , {
                "id": 5,
                "Agent": "Ali"
            }]

        }
    }
    render() {
        console.log(this.state.data)

        return (
            <div className="Courses">
                <div className="container">
                    <div>
                        {
                            this.state.data.map((value, id) => {
                                return (
                                    <Cards key={id} showButton="true" data={value} agents={this.state.agents} />
                                )
                            })
                        }
                    </div>
                </div>
            </div>
        );
    }
}

export default CourseHome;
